import FriendsBar from "./FriendsBar";
import Content from "./Content";
import React, { Component } from "react";
import { Tabs } from "react-bootstrap";
import { Redirect } from "react-router-dom";
import { Tab, Container, Row, Col, Nav, ToggleButtonGroup, ToggleButton} from "react-bootstrap";
import { connect } from "react-redux";
import Stopwatch from "./Stopwatch";
import "../../styles/maincontent.css";

export class MainContent extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    if (!this.props.auth.uid) {
      return <Redirect to="/login" />;
    }
    return (
      <div>
        <FriendsBar />

        {/* // <Tab.Container id="buttons">
        //   <Row>
        //     <Col>
        //       <Nav>
        //           <Nav.Item>
        //             <Nav.Link id="first" eventKey="first">
        //               Line
        //             </Nav.Link>
        //           </Nav.Item>
        //           <Nav.Item>
        //             <Nav.Link eventKey="second">
        //               Bar
        //             </Nav.Link>
        //           </Nav.Item>
        //           <Nav.Item>
        //             <Nav.Link eventKey="third">
        //               Doughnut
        //             </Nav.Link>
        //           </Nav.Item>
        //       </Nav>
        //     </Col>
        //   </Row>
        // </Tab.Container> */}



        {/* <Stopwatch /> */}

        <Container fluid className="graph-container">
          <Tabs
            defaultActiveKey="profile"
            id="graph-buttons"
            style={{
              display: "flex",
              justifyContent: "center",
              alignItems: "center",
            }}
            variant={"pills"}
          >
            <Tab id="line-tab" eventKey="line" title="Line">
              <Content greeting={"line"} />
            </Tab>
            <Tab id="bar-tab" eventKey="otherline" title="OtherLine">
              <Content greeting={"bar"} />
            </Tab>
            <Tab id="doughnut-tab" eventKey="doughnut" title="Doughnut">
              <Content greeting={"doughnut"} />
            </Tab>
          </Tabs>
        </Container>
      </div>
    );
  }
}

const mapStatetoProps = (state) => {
  console.log(state);
  return {
    auth: state.firebase.auth,
  };
};

export default connect(mapStatetoProps)(MainContent);
